{
  return vLedPositions;
}


export function Initialize()
{      
    return "Nommo Connected";
}

function SendPacket(value,speaker)
{
    var packet = new Array(91).fill(0);
    packet[0] = 0x00;
    packet[1] = 0x00; //Start
    packet[2] = 0x1F;
    packet[3] = 0x00;
    packet[4] = 0x00;
    packet[5] = 0x00;
    packet[6] = 0x4D;
    packet[7] = 0x0F;
    packet[8] = 0x03;
    packet[9] = 0x00;
    packet[10] = 0x00;
    packet[11] = speaker;
    packet[12] = 0x00;
    packet[13] = 0x17;
    


    for(var iIdx = 0; iIdx < vLedPositions.length; iIdx++){

        
        var iPxX = vLedPositions[iIdx][0];
        var iPxY = vLedPositions[iIdx][1];

        if(speaker == 0){
            var col = device.color(14+iPxX, iPxY);
        }else{
            var col = device.color(iPxX, iPxY);
        }

        var iLedIdx = (iIdx*3) + 14;

        packet[iLedIdx] = col[0]; //0; //0xF7;
        packet[iLedIdx+1] = col[1]; //0;
        packet[iLedIdx+2] = col[2]; //255;

    }


    packet[86] = 0x00;
    packet[87] = 0x00;
    packet[88] = 0x00;
    packet[89] = value;
    packet[90] = 0x00;

    device.send_report(packet, 91);
    device.pause(1); // We need a pause here (between packets), otherwise the ornata can't keep up.
    
}

export function Render()
{                

    SendPacket(57,0);
    SendPacket(57,1);
         
}


